const App = () => {
  const [clicks, setClicks] = useState({
    left: 0,
    right: 0,
  });

  const handleLeftClick = () => {
    setClicks({
      left: clicks.left + 1,
      right: clicks.right,
    });
  };
  return <></>;
};

export default App;
